<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Movies in South Africa</title>
    <style>
        /* 기존 스타일 코드 유지 */
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: flex-start;
            padding: 20px;
        }

        .dropdown-container {
            position: absolute;
            top: 20px;
            left: 20px;
            z-index: 1000;
        }

        .dropdown {
            padding: 10px;
            font-size: 16px;
            cursor: pointer;
        }

        .visualization-container {
            display: flex;
            justify-content: space-between;
            width: 100%;
            max-width: 1200px;
            margin: 20px 0;
        }

        .visualization-section {
            flex: 1;
            padding: 20px;
            box-sizing: border-box;
            text-align: center;
            margin: 0 10px;
        }

        .movie-container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
        }

        .movie-container img {
            width: 150px;
            height: 200px;
            object-fit: cover;
            border: 1px solid #ccc;
            border-radius: 8px;
        }

        /* 시각화 콘텐츠에 이미지 크기 맞추기 */
        .visualization-section img {
            width: 100%;
            height: auto;
        }
    </style>
</head>

            <option value="United Kingdom" >United Kingdom</option>
            <option value="Australia" >Australia</option>
            <option value="South Africa" selected>South Africa</option>
        </select>
    </div>
